import React from "react";

const Outputs = () => {
  const grade = 90;
  const totalWeight = 100;
  return (
    <section className="outputs">
      <h3>Your Grades</h3>
      <p>
        Grade: <span style={{ backgroundColor: "white" }}>{grade}</span>{" "}
      </p>
      <p style={{ fontWeight: "bold" }}>Total Weight: {totalWeight}</p>
    </section>
  );
};

export default Outputs;
